import { Nav } from './Nav'
import { useState } from 'react';
import './products.css'
import {image} from '../'



const Product = (props) => {
    return (
        <div className='card'>
            <p>{props.title}</p>
            <img src={props.img}></img>
        </div>
    )
}
const Products = () => {
    const initialProducts = [
        { id: 0, name: "Fish - Betta splendens - Plakat Koi - Siamese fighting fish", image: "./images/f0.jpg", price: 23.17 },
        { id: 1, name: "Fish - Betta splendens - Plakat - Siamese fighting fish", image: "url", price: 10.12 },
        { id: 2, name: "Fish - Phenacogrammus interruptus - Congo tetra", image: "url", price: 5.19 },
        { id: 3, name: "Fish - Thayeria boehlkei - Pinguin tetra", image: "url", price: 1.31 },
        { id: 4, name: "Fish - Pterophyllum scalare - Angelfish", image: "url", price: 5.77 },
        { id: 5, name: "Fish - Boeseman's rainbowfish Melanotaenia - boesemani", image: "url", price: 4.90 },
        { id: 6, name: "Fish - Corydoras panda", image: "url", price: 2.87 },
        { id: 7, name: "Fish - Corydoras aeneus sp.black venezuela", image: "url", price: 2.87 },

    ]
    const [products, setProducts] = useState(initialProducts)

    console.log(products)
    return (
        <div className="products">
            <Nav />
            {products.map((product) => <Product title={product.name} img={product.image} key={product.id} />)}
        </div>
    );
};

export default Products;
